import React from 'react';
import { Box, Typography } from '@material-ui/core';
import { SkillsData } from './SkillsData';


const Skills = () => {
    return (<>
        {SkillsData.map((item, index) => {
            return (<Box key={index} my={2}>
                <Typography variant="h6">{item.barTitle}</Typography>
                <div className="progress">
                    <div className={item.barClassName} style={{ width: item.barWidth }}>
                        <Typography variant="body2">{item.barWidth}</Typography>
                    </div>
                </div>
            </Box>)
        })}
    </>)
}

export default Skills
